import { StyleSheet } from 'react-native';
const barratop = StyleSheet.create({
    backgroundImage: {
      flex: 1, // Asegura que la imagen ocupe todo el espacio disponible
      justifyContent: 'center',
      alignItems: 'center',
      width: 160,
      height: 50,
      bottom: 25
    },
    container: {
      bottom: 1,
      padding: 20
    },
    text: {
      fontSize: 20,
      color: 'white',
      textAlign: 'center',
      width: '100%',
      height: '100%',
      bottom: 1
    },
  });
  export {barratop};
